import React, { useState } from 'react';


const Event=()=>{

    let purple='&8e44ad';
    let [curBg,updateBg]= useState(purple);

    const ChangeBG=()=>{
        console.log('click')
        updateBg();
    }
    return(
        <>
        <div style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>{curBg}
        <button onClick={ChangeBG} style={{ padding: '0.5rem', color: 'white', backgroundColor: 'purple', outline: 'none', borderRadius: '10px', border: '0px', margin: '0px 5px 1px 0' }}>Click Me</button>
        </div>
        </>
    )
}

export default Event;
